import React from "react";
import ReactDOM from "react-dom";

class App extends React.Component {
  render() {
    return (
      <div class="ui four column grid">
        <div class="row">
          <div class="column" />
          <div class="column" />
          <div class="column" />
        </div>
        <div class="row">
          <div class="column" />
          <div class="column" />
          <div class="column" />
        </div>
        <div class="row">
          <div class="column" />
          <div class="column" />
          <div class="column" />
        </div>
      </div>
    );
  }
}

ReactDOM.render(<App />, document.querySelector("#root"));
